import React from 'react';
const weatherAPI = {
  key: "8bd04b4c4bc8f493a35b227dba34ae78",
  baseURL: "http://api.weatherapi.com/v1"
}

function App() {

  fetch(`https://api.openweathermap.org/data/2.5/weather?lat={1}&lon={1}&appid=${weatherAPI.key}}`)
    .then(response => console.log(response));

  return (
    <div>
      <h1>Weather app</h1>
    </div>
  );
}

export default App;
